ID:  Coffee arabica
.
My husband loves his coffee. I do too but I have to limit it to weekends and times when I'm relaxed. I get a bit overstimulated by caffeine - ask my friends 😅
.
During lockdown we would take long walks round the Gibraltar Botanic Gardens and noticed one of the most amazing things I have witnessed this year; Coffee cherries growing outdoors in Gibraltar!! 
.
We watched them turn from green to an intense red. Then one day at their peak they were gone. I really hoped that they hadn’t proved too tempting for enthusiastic hands. Thankfully, I didn’t have to wait long to find out about their fate. I got a photo from a friend sipping a perfect brew of Alameda grown coffee!!!
.
I have 6 plantlets at home. Picked up as a novelty at a vivero a couple of years ago after a trip to Lisbon. Now the challenge is on. Cafe Comedia homegrown edition coming soon 🤞🏻 
.
